import styled from 'styled-components';

export const HeaderWrapper = styled.header`
	h1
		display: grid;
		grid-template-columns: 1fr 3fr 1fr;
		grid-auto-rows: 58px;
		border-bottom: 1px solid rgb(51,51,51);
`
